var tipuesearch = {"pages": [{'title': 'About', 'text': 'cd2020-bg1分組網站: https://s40723246.github.io/cd2020-bg1/content/index.html \n group members 吳沛汶Repository: \xa0 40723201 \xa0 | Site: \xa0 40723201 王冠驊Repository: \xa0 40723206 \xa0 | Site: \xa0 40723206 \xa0(小組長) 杜玗宸Repository: \xa0 40723213 \xa0 | Site: \xa0 40723213 林子欽Repository: \xa0 40723216 \xa0 | Site: \xa0 40723216 洪維成Repository: \xa0 40723223 \xa0 | Site: \xa0 40723223 高立倫Repository: \xa0 40723226 \xa0 | Site: \xa0 40723226 陳羽泓Repository: \xa0 40723229 \xa0 | Site: \xa0 40723229 \xa0 (小組長) 陳冠樺Repository: \xa0 40723230 \xa0 | Site: \xa0 40723230 葉承叡Repository: \xa0 40723241 \xa0 | Site: \xa0 40723241 趙子得Repository: \xa0 40723242 \xa0 | Site: \xa0 40723242 \xa0(小組長) 鄭竣元Repository: \xa0 40723246 \xa0 | Site: \xa0 40723246 \xa0 (group leader) Repository: \xa0 40732319 \xa0 | Site: \xa0 40732319 \n', 'tags': '', 'url': 'About.html'}, {'title': 'week', 'text': '', 'tags': '', 'url': 'week.html'}, {'title': 'week1-5', 'text': 'week1 \n 1.將 2019Fall可攜套件.7z 下在至USB內並進行解壓縮 \n 2.進入 Github \xa0 ， 創一個新的倉儲,命名為\'\'cd2020\'\' \n 3.git clone至自身的USB \n 4. 輸入git submodule add https://github.com/mdecourse/cmsimde.git \n 5.下載附件 python -m pip install flask_cors \n 6. 將up_dir的裡的資料複 製到cd2020 \n 7.進入 cmsimde 輸入 python wsgi.py 編輯頁面 \n 8.編輯完進入靜態網頁 ，到cad2019推上Github \n \xa0git add .\xa0 ⇒ git commit\xa0 -m "名稱"\xa0⇒ git push \n week2 \n 將可攜系統下的python 3.7.3系統更新至python 3.8.2 \n 1.下載goole search \xa0 PYTHON \xa0 \n 2.下載 Windows x86-64 executable installer \xa0 \n 3.載完點並 不要勾選pip選項，接著按下next選取放置資料夾 \n 4.在隨身系統下新增放置資料夾cd2020， 並在cd2020下新建資料夾data，data/py382/ wscite432/portablegit \n 5.下載SciTE系統 \xa0 full 64-bit download ，下載完後解壓縮至data下的wscite432 \n 6.在cd2020下建立新的start.bat及stop.bat \n 7.至 SciTE系統更改 start.bat及stop.bat \n 到\xa0 Options → Open Global Option File \xa0，至139行及300行將前方#拿掉並補上301行的# \n \n \n 8. 載入msys2\xa0 msys2-x86_64-20190524.exe \xa0至data 9. 載入PortableGit\xa0 64-bit Git for Windows Portable \xa0至 portablegit 10 .裝入 pip ，另存新檔到data 11.測試 python3.8.2版本 \n \n 第一組分組討論: \n 會議流程: \n 成員簽到 \xa0 \n 討論日後分工 \xa0 \n week3 \n 分配結果: \n week4 \n 本周各組員皆須對各組員繳交之 Assignment 1進行 評分 \n', 'tags': '', 'url': 'week1-5.html'}, {'title': 'week6-9', 'text': 'WEEK6 \n 下載OBS \n OBS下載網址: https://obsproject.com/download \n IVCAM: https://www.e2esoft.com/ivcam/ \n 往後錄製影片使用 \n 第一組第二次作業分配:翻譯文章 \n 第1章成功的設計 \n 1.1\xa0 設計指南 \n \n 設計指南 \n \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0 \xa0 助於擴大設計師過去的全部經驗以及他們現在的組織的建立流程。 \n \n 電子產品外殼（ EPE = 電子產品外殼） \n \n \xa0\xa0\xa0\xa0\xa0\xa0 \xa0 由內部和外部結構組成產品的要素。 \n \n EPE 設計師 \x9e \n \n \xa0理解並符合產品規格的能力。\x9e 能夠添加並幫助創建產品規格。\x9e 為產品提出的問題創建創造性的解決方案。 \n 1.2\xa0 定義整體團隊 \n 團隊可以是：\x9e \n ．小型或大型。\x9e \n ． 位於一個位置或分佈在全球。\x9e \n ． 資源有限或可以訪問幾乎無限的資源。\x9e \n ． 是否擁有最新工具。\x9e \n ． 出於各種原因而實現目標的動機。\x9e \n ． 經驗豐富。 \n \xa0 \xa0 \u3000整個工程包含著多個學科之間的設計融合。例如：軟件和硬體工程、機械工程（包括結構和熱學）、系統工程 … 。 \n \u3000\u3000因此，知道機械工程只是電子產品整體工程設計的一部分，並且許多決策是與其他學科合作而成的。這些都是為了強調機械設計不是“憑空”完成，而是作為團隊共同努力的結果。 \n 1.3\xa0 產品要求 \n \n 產品將為客戶帶來什麼成就。 \n 說明產品如何與客戶互動。 \n 產品各組件的描述。 \n 展示產品的最終外觀。 \n 產品將在運行中和放置的環境，包括：溫度、衝擊、跌落、振動、濕度…。 \n 產品需要通過測試達到所有標準。包括安全和法規標準，例如：安全性保險商實驗室（ UL ）、電動勢電磁干擾（ EMI ）…。 \n \n 1.3.1規範功能 \n \n 最少的輸入。 \n 完整規格。 \n 工作規範。 \n \n 1.3.2準時按計劃進行 \n 1.3.3交貨的預計成本 \n \n 修改完成項目所需的人力資源。 \n 完成的項目所需資源被修改。 \n 修訂產品的預期銷售成本。 \n \n 1.4 草繪與細節 \n \u3000\u3000 EPE 設計人員必須知道何時在以下兩種模式之間切換： \n \n 草繪或集思廣益： 快速思考產品如何設計，同時獲得他人的反饋更改選擇。規模並不是很重要，速度才是這裡的重點。 \n 詳圖： 在“詳細模式”下，可以準確計算出設計中的一些關鍵部分 \n \n 1.5 設計評論 \n \u3000\u3000正式的設計評審通常是按照項目時間表上的計劃進行。 \n \u3000\u3000非正式的設計評審是偶爾或自發進行的。就像設計師去辦公室並要求同事“看看”、在設計師認為足夠接近設計問題或已有經驗的少數人中召開簡短會議。 \n 1.6 溝通 \n \u3000\u3000 溝通是設計成功的必要條件。這句話本身是正確的，但值得進行更充分的討論。 \n 1.6.1溝通目的 \n \u3000\u3000交流的目的是傳達有關設計的信息。 \n 1.6.2溝通的價值 \n \u3000\u3000良好的溝通將使項目更加成功。 \n 1.6.3通信鏈中的連接 \n \u3000\u3000交流的目標之一是將信息提供給需要的人，團隊包括很多學科。 EPE 設計師應在團隊中涉及所有人員做出決定，這些人對於做出決定非常重要。 \n 1.7 工程經濟 \n \u3000\u3000不論工程經濟學的基本原理，就不可能完成設計。幾乎所有的工作中，“付出什麼代價”都是最重要的考慮因素。在許多產品設計中，它將成為此產品成功或失敗的主要原因之一。 \n 章節總結 \n \u3000\u3000介紹如何將設計視為“成功”，以及設計如何滿足產品要求。 \n \xa0 \n 參考文件: \xa0 MechanicalDesignProcess.pdf . \n week7 \n', 'tags': '', 'url': 'week6-9.html'}, {'title': 'Week10-15', 'text': '', 'tags': '', 'url': 'Week10-15.html'}, {'title': 'Assignment', 'text': '', 'tags': '', 'url': 'Assignment.html'}, {'title': 'Assignment 1', 'text': '更新可攜系統 \n 將可攜系統下的python 3.7.3系統更新至python 3.8.2 \n 1.下載goole search \xa0 PYTHON \xa0 \n 2.下載 Windows x86-64 executable installer \xa0 \n 3.載完點並 不要勾選pip選項，接著按下next選取放置資料夾 \n 4.在隨身系統下新增放置資料夾cd2020， 並在cd2020下新建資料夾data，data/py382/ wscite432/portablegit \n 5.下載SciTE系統 \xa0 full 64-bit download ，下載完後解壓縮至data下的wscite432 \n 6.在cd2020下建立新的start.bat及stop.bat \n 7.至 SciTE系統更改 start.bat及stop.bat \n 到\xa0 Options → Open Global Option File \xa0，至139行及300行將前方#拿掉並補上301行的# \n \n \n 8. 載入msys2\xa0 msys2-x86_64-20190524.exe \xa0至data 9. 載入PortableGit\xa0 64-bit Git for Windows Portable \xa0至 portablegit 10 .裝入 pip ，另存新檔到data 11.測試 python3.8.2版本 \n \n', 'tags': '', 'url': 'Assignment 1.html'}, {'title': 'Assignment 2', 'text': '', 'tags': '', 'url': 'Assignment 2.html'}, {'title': 'Assignment 3', 'text': '', 'tags': '', 'url': 'Assignment 3.html'}]};